import React from "react";

function FormFloating(props) {
  return (
    <div className={`relative ${props.class || ""}`}>
      <input
        type={props.type}
        id={props.name}
        name={props.name}
        className="block px-2.5 pb-2.5 pt-4 w-full text-sm text-gray-900 bg-transparent rounded-lg border appearance-none focus:outline-none focus:ring-0 focus:border-blue-600 peer"
        placeholder=" "
      />

      <label
        htmlFor={props.name}
        className="absolute text-sm text-gray-500 duration-300 transform -translate-y-4 scale-75 top-2 z-10 origin-[0] bg-white px-2 
        peer-focus:px-2 peer-focus:text-blue-600 
        peer-placeholder-shown:scale-100 peer-placeholder-shown:-translate-y-1/2 peer-placeholder-shown:top-1/2 
        peer-focus:top-2 peer-focus:scale-75 peer-focus:-translate-y-4 
        rtl:peer-focus:translate-x-1/4 rtl:peer-focus:left-auto start-1"
      >
        <i className={props.icon}></i>&nbsp;{props.text}
      </label>

      {props.name === "password" && (
        <span onClick={props.tooglepw} className="absolute top-1/2 right-4 transform -translate-y-1/2 cursor-pointer text-gray-400 hover:text-gray-600">
          <i className={`${props.pw ?'bi bi-eye' :'bi bi-eye-slash'}`}></i>
        </span>
      )}
    </div>
  );
}
function Button(props) {
  return (
    <button
      className={`bg-${props.color} cursor-pointer active:shadow-lg w-full p-2 text-${props.textColor} font-semibold rounded-2xl`}
      type={`${props.type}`}
    >
      {props.text}
    </button>
  );
}
export { FormFloating, Button };
